import React, {useState} from "react";
import "./styles/styles.scss";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./components/Pages/Home/Home";
import NavBar from "./components/Layout/navBar/navBar";

export default function App() {
  const [completedFormState, setCompletedFormState] = useState (false)
  function handleCompletedForm(){
    setCompletedFormState(!completedFormState)
   }

  return (
    <BrowserRouter>
      <NavBar 
        completedFormState={completedFormState} 
      />
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/completedForm" element={<Home/>}/>
      </Routes>
    </BrowserRouter>
  );
}
